func TestForMatToMap(t *testing.T) {
	transfer, ok := KnowMethods["transfer(address,uint256)"]
	if !ok {
		t.Fatal("can't find method")
	}
	fmt.Println(transfer)
	if transfer != "a9059cbb" {
		t.Fatal("must be a9059cbb")
	}
}

