func TestEIP165(t *testing.T) {
	if "a9059cbb" != EIP165Method("transfer(address,uint256)") {
		t.Fatal("must equal")
	}
	if "ddf252ad1be2c89b69c2b068fc378daa952ba7f163c4a11628f55a4df523b3ef" != EIP165Event(`Transfer(address,address,uint256)`) {
		t.Fatal("must equal")
	}
	pregnant := EIP165Event("Pregnant(address,uint256,uint256,uint256)")
	if "241ea03ca20251805084d27d4440371c34a0b85ff108f6bb5611248f73818b80" != pregnant {
		t.Fatal(pregnant)
	}
	birth := EIP165Event("Birth(address,uint256,uint256,uint256,uint256)")
	if birth != `0a5311bd2a6608f08a180df2ee7c5946819a649b204b554bb8e39825b2c50ad5` {
		t.Fatal(birth)
	}
}

func TestEIP165Event(t *testing.T) {
	fmt.Println("Transfer(address,address,uint256)--", EIP165Event("Transfer(address,address,uint256)"))
	fmt.Println("Approval(address,address,uint256)--", EIP165Event("Approval(address,address,uint256)"))
	fmt.Println("ApprovalForAll(address,address,bool)--", EIP165Event("ApprovalForAll(address,address,bool)"))
}

func TestEIP165Method(t *testing.T) {
	fmt.Println("balanceOf(address)--", EIP165Method("balanceOf(address)"))
	fmt.Println("safeTransferFrom(address,address,uint256,bytes)--", EIP165Method("safeTransferFrom(address,address,uint256,bytes)"))
	fmt.Println("safeTransferFrom(address,address,uint256)--", EIP165Method("safeTransferFrom(address,address,uint256)"))
	fmt.Println(`supportsInterface(bytes4)--`, EIP165Method(`supportsInterface(bytes4)`))
	fmt.Println(`setApprovalForAll(address,bool)`, EIP165Method(`setApprovalForAll(address,bool)`))
	fmt.Println(`getApproved(uint256)`, EIP165Method(`getApproved(uint256)`))
	fmt.Println(`isApprovedForAll(address,address)`, EIP165Method(`isApprovedForAll(address,address)`))
}
